// Header.js

import React from 'react';
import { HeaderContainer, HeaderContent, HeaderLogo, HeaderLinks } from './Header.styles.js';

const Header = () => {
  return (
    <HeaderContainer>
      <HeaderContent>
        <HeaderLogo>
          Atlantic City Public Works
        </HeaderLogo>
        <HeaderLinks>
          <a href="/home">Home</a>
          <a href="/features">Features</a>
          <a href="/pricing">Pricing</a>
          <a href="/contact">Contact</a>
        </HeaderLinks>
      </HeaderContent>
    </HeaderContainer>
  );
};

export default Header;
